def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data._get_numeric_data(copy=False)

    agg_items = data.items
    agg_blocks = []
    for block in data.blocks:
        try:
            result, _ = self.grouper.aggregate(block, how)
        except NotImplementedError:
            if alt is None:
                raise
            result = alt(block)
        # handle Int64 dtype for aggregation
        result, _ = maybe_convert_objects(result, data.items, copy=False)
        result = maybe_downcast_to_dtype(result, dtype=block.dtype)
        agg_blocks.append(make_block(result, placement=block.mgr_locs, ndim=1))

    return agg_blocks, agg_items
